CREATE TABLE IF NOT EXISTS pa_boundary
(
    gid      SERIAL
        PRIMARY KEY,
    statefp  VARCHAR(2),
    statens  VARCHAR(8),
    affgeoid VARCHAR(11),
    geoid    VARCHAR(2),
    stusps   VARCHAR(2),
    name     VARCHAR(100),
    lsad     VARCHAR(2),
    aland    DOUBLE PRECISION,
    awater   DOUBLE PRECISION,
    geom     geometry(MultiPolygon, 4326)
);

CREATE INDEX IF NOT EXISTS pa_boundary_geom_idx
    ON pa_boundary USING gist (geom);

